const valueCardsPDFGenerator = () => {

    const jsPDF = window.jspdf.jsPDF;

    const CARD_WIDTH = 95;
    const CARD_HEIGHT = 95;
    const CARD_DISTANCE = 10;
    const CARD_COLOR = '#921f82';
    
    const cardFront = (doc, x, y, text) => {
    
        doc.setDrawColor(0);
        doc.setFillColor(CARD_COLOR);
        doc.rect(x, y, CARD_HEIGHT, CARD_WIDTH, 'F');

        doc.setTextColor(255, 255, 255);
        doc.setFontSize(28);
        doc.setFont('Pasajero');
        doc.text(x + CARD_WIDTH / 2 - doc.getTextWidth(text) / 2, y + CARD_HEIGHT / 2 + 3, text);
       
    }

    const createCardFrontPage = (doc, cards) => {

        const x = 5;
        const y = 5;

        const positions = [
            {x, y},
            {x: x + CARD_HEIGHT + CARD_DISTANCE, y},
            {x, y: y + CARD_WIDTH + CARD_DISTANCE},
            {x: x + CARD_HEIGHT + CARD_DISTANCE, y: y + CARD_WIDTH + CARD_DISTANCE}
        ]

        for(let i = 0; i < positions.length ; i++) {
            if(cards[i] != null)
                cardFront(doc, positions[i].x, positions[i].y, cards[i])
        }

        doc.setDrawColor('#CDCDCD');
        doc.setLineWidth(0.1);
        doc.line(CARD_DISTANCE / 2, CARD_DISTANCE + CARD_HEIGHT, CARD_WIDTH * 2 + CARD_DISTANCE + CARD_DISTANCE/2, CARD_DISTANCE + CARD_HEIGHT);
        doc.line(CARD_DISTANCE / 2, CARD_DISTANCE + CARD_HEIGHT * 2 + CARD_DISTANCE, CARD_WIDTH * 2 + CARD_DISTANCE + CARD_DISTANCE/2, CARD_DISTANCE + CARD_HEIGHT * 2 + CARD_DISTANCE);
        doc.line(CARD_DISTANCE + CARD_WIDTH, CARD_DISTANCE / 2, CARD_DISTANCE + CARD_WIDTH, CARD_DISTANCE * 2 + CARD_HEIGHT * 2);

        const text = "[print single sided and cut]";
        doc.setTextColor('#587183');
        doc.setFontSize(18);
        doc.setFont('Pasajero');
        doc.text(doc.internal.pageSize.getWidth() / 2 - doc.getTextWidth(text) / 2, y + CARD_HEIGHT * 2 + CARD_DISTANCE * 3 + 20 , text);

    }

    const generatePdf = (cards) => {

        const doc = new jsPDF({
            orientation: 'p',
            unit: 'mm',
            format: 'a4',
        });

        let firstPage = true;

        const chunk = 4;
        for (let i=0; i< cards.length; i+=chunk) {
            const tempArray = cards.slice(i,i+chunk);
            if(!firstPage)
                doc.addPage();
            createCardFrontPage(doc, tempArray)
            firstPage = false
        }
       

        return doc;
    }

    const downloadPdf = (cards) => {
        const doc = generatePdf(cards);
        doc.save("value_cards.pdf")
    }

    return {
        generatePdf,
        downloadPdf,
    }

}

const lensesCardsPDFGenerator = () => {

    const jsPDF = window.jspdf.jsPDF;

    const CARD_WIDTH = 150;
    const CARD_HEIGHT = 100;
    const CARD_DISTANCE = 10;
    const BACKGROUND_IMAGE = 'data:image/png;base64,';
    
    const cardFront = (doc, x, y, text) => {

        doc.addImage(BACKGROUND_IMAGE, 'PNG', x + CARD_DISTANCE / 2, y, 77, 140);

        doc.setTextColor(0, 0, 0);
        doc.setFontSize(20);
        doc.setFont('Pasajero');
        doc.text(x + CARD_HEIGHT / 2, y + 33 - doc.getTextWidth(text) / 2, text.toLowerCase(0), null, 270);
    }

    const createCardFrontPage = (doc, cards) => {

        const x = 5;
        const y = 5;

        const positions = [
            {x, y},
            {x: x + CARD_HEIGHT, y},
            {x, y: y + CARD_WIDTH},
            {x: x + CARD_HEIGHT, y: y + CARD_WIDTH}
        ]

        for(let i = 0; i < positions.length ; i++) {
            if(cards[i] != null)
                cardFront(doc, positions[i].x, positions[i].y, cards[i])
        }

        doc.setDrawColor('#CDCDCD');
        doc.setLineWidth(0.1);
        doc.line(CARD_DISTANCE / 2, CARD_WIDTH, CARD_HEIGHT * 2 + CARD_DISTANCE / 2, CARD_WIDTH);
        doc.line(CARD_DISTANCE / 2 + CARD_HEIGHT, CARD_DISTANCE / 2, CARD_DISTANCE / 2 + CARD_HEIGHT, CARD_WIDTH * 2);
       
    }

    const generatePdf = (cards) => {

        const doc = new jsPDF({
            orientation: 'p',
            unit: 'mm',
            format: 'a4',
        });

        let firstPage = true;

        const chunk = 4;
        for (let i=0; i< cards.length; i+=chunk) {
            const tempArray = cards.slice(i,i+chunk);
            if(!firstPage)
                doc.addPage();
            createCardFrontPage(doc, tempArray)
            firstPage = false
        }
       

        return doc;
    }

    const downloadPdf = (cards) => {
        const doc = generatePdf(cards);
        doc.save("lens_cards.pdf")
    }

    return {
        generatePdf,
        downloadPdf,
    }

}